import classNames from 'classnames/bind';
import styles from './Login.module.scss';

const cx = classNames.bind(styles);

function Login() {
    return (
        <div className={cx('wrapper')}>
            <div className={cx('logo')}>
                <img
                    src="data:image/png;base64,"
                    alt="DataWarehouse Logo"
                />
            </div>
            <div className={cx('container')}>
                <h3 className={cx('sign-in-title')}>Sign In</h3>
                <form className={cx('login-form')} onSubmit={(e) => e.preventDefault()}>
                    {' '}
                    {/* Add onSubmit to prevent default form submission */}
                    <div className={cx('form-group')}>
                        <label htmlFor="username">Username</label>
                        <input type="text" id="username" className={cx('input-field')} placeholder="" />
                    </div>
                    <button type="submit" className={cx('sign-in-button')}>
                        Sign In
                    </button>
                </form>
            </div>
        </div>
    );
}

export default Login;
